import React from "react";
import Layout from "./layout.js"; // Import the Layout component
import "./DiseasesPage.css"; // Import the CSS for styling

const DiseasesPage = () => {
  const diseases = [
    { code: "k0001", name: "Abscess Periodontal" },
    { code: "k0002", name: "Abscess Periapical" },
    { code: "k0003", name: "Anodontia" },
    { code: "k0004", name: "Tooth Abrasion" },
    { code: "k0005", name: "Bruxism" },
    { code: "k0006", name: "Caries" },
    { code: "k0007", name: "Dental Erosion" },
    { code: "k0008", name: "Gingivitis" },
    { code: "k0009", name: "Halitosis" },
    { code: "k0010", name: "Oral Cancer" },
  ];

  return (
    <Layout>
      <div className="diseases-page">
        <h1>Diseases</h1>
        <ul>
          {diseases.map((disease) => (
            <li key={disease.code}>
              {disease.name} ({disease.code})
            </li>
          ))}
        </ul>
      </div>
    </Layout>
  );
};

export default DiseasesPage;
